INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DHY', 'STOCK', 'Credit Suisse High Yield Bond Fund, Inc.', 'ASE', 'Financial Services', 'Asset Management', 'Credit Suisse High Yield Bond Fund, Inc. is a closed ended fixed income mutual fund launched and managed by Credit Suisse Asset Management, LLC. The fund invests in the fixed income markets of the United States. It invests in the securities of companies across diversified sectors. The fund primarily invests in below-investment-grade corporate bonds with an average credit quality lower than BBB by Standard & Poor''s and an average duration of 5.07 years. It focuses factors like financial condition, cash flow and borrowing requirements, value of assets in relation to cost, strength of management, responsiveness to business conditions, credit standing and anticipated results of operations to make its investments. The fund benchmarks the performance of its portfolio against the BofA Merrill Lynch High Yield Master II Constrained Index. Credit Suisse High Yield Bond Fund, Inc. was formed on July 31, 1998 and is domiciled in the United States.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BRDG', 'STOCK', 'Bridge Investment Group Holdings Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Bridge Investment Group Holdings Inc. is an alternative investment manager, diversified across specialized asset classes. The Company is focused on various specialized and synergistic investment platforms, including real estate, credit, renewable energy and secondaries strategies. Under Real Estate, it offers multifamily, development, workforce and affordable housing, seniors housing, office, single-family rental, and logistics. Under Credit, it offers debt strategies, net lease income and agency MBS. Secondaries investment platform focuses on acquiring limited partnership interests in established buyout, growth equity and venture capital funds. Its vertically integrated approach includes investment professionals as well as employees who perform active asset management, property management, leasing, and construction management functions. It operates across 34 states and focuses its investment activity on the United States market.', 'Salt Lake City, UT, United States', 2250);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALGT', 'STOCK', 'Allegiant Travel Company', 'NMS', 'Industrials', 'Airlines', 'Allegiant Travel Company is an integrated travel company focused on providing travel and leisure services and products to residents of under-served cities in the United States. The Company provides various travel services and products, including scheduled service air transportation, ancillary air-related products and services, third party products and services, and fixed-fee contract air transportation. The Company operates through two segments: Airline and Sunseeker Resort. The Airline segment operates as a single business unit and includes all scheduled service air transportation, ancillary air-related products and services, third party products and services, fixed fee contract air transportation and other airline-related revenue. The Sunseeker Resort segment operates as a single business unit and includes hotel rooms and suites for occupancy, group meeting facilities, food and beverage options, the Aileron Golf Course and other Resort amenities.', 'Las Vegas, NV, United States', 5980);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AAT', 'STOCK', 'American Assets Trust, Inc.', 'NYQ', 'Real Estate', 'REIT - Diversified', 'American Assets Trust, Inc. is a full service, vertically integrated and self-administered real estate investment trust (REIT). The Company is engaged in acquiring, improving, developing and managing office, retail, and residential properties throughout the United States in high-barrier-to-entry markets primarily in Southern California, Northern California, Washington, Oregon, Texas and Hawaii. The Company''s office portfolio comprises approximately 4.1 million rentable square feet, and its retail portfolio comprises approximately 2.4 million rentable square feet. In addition, it owns one mixed-use property (including approximately 94,000 rentable square feet of retail space and a 369-room all-suite hotel) and 2,302 multifamily units. The Company''s properties include Alamo Quarry Market, La Jolla Commons, Carmel Country Plaza, and Waikiki Beach Walk Retail, Embassy Suites Hotel, Carmel Mountain Plaza, Corporate Campus East III, Gateway Marketplace, Imperial Beach Gardens, and others.', 'San Diego, CA, United States', 236);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CION', 'STOCK', 'CION Investment Corporation', 'NYQ', 'Financial Services', 'Asset Management', 'CION Investment Corporation is an externally managed, non-diversified closed-end management investment company. The Company''s investment objective is to generate current income and, to a lesser extent, capital appreciation for investors. Its portfolio is comprised primarily of investments in senior secured debt, including first lien loans, second lien loans and unitranche loans, and, to a lesser extent, collateralized securities, structured products and other similar securities, unsecured debt, and equity, of private and thinly traded United States middle-market companies. The Company''s investment portfolio includes healthcare and pharmaceuticals, chemicals, plastics and rubber, high-tech industries, beverage, food and tobacco, capital equipment, banking, finance, insurance and real estate, aerospace and defense, construction and building, telecommunications, hotel, gaming, and leisure, automotive, and metals and mining. Its investment adviser is CION Investment Management, LLC.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMED', 'STOCK', 'Amedisys, Inc.', 'NMS', 'Healthcare', 'Medical Care Facilities', 'Amedisys, Inc. is a healthcare services company. It provides in-home healthcare and related services to the chronic, co-morbid and aging American population. Its segments include home health, hospice and high acuity care. Its home health segment delivers a range of services in the homes of individuals who may be recovering from an illness, injury or surgery. Its nurses administer medications, care for wounds, monitor vital signs and provide a range of other nursing services. Its hospice segment provides care that is designed to provide comfort and support for those who are facing a terminal illness. Its high acuity care segment delivers the essential elements of inpatient hospital, palliative and skilled nursing facility care to patients in their homes. It owns and operates 347 Medicare-certified home health care centers, 164 Medicare-certified hospice care centers and eight admitting high acuity care joint ventures in 38 states within the United States and the District of Columbia.', 'Baton Rouge, LA, United States', 19000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARGX', 'STOCK', 'argenx SE', 'NMS', 'Healthcare', 'Biotechnology', 'A Argenx SE, anteriormente Argen X BV, é uma empresa biofarmacêutica com sede na Holanda. Está principalmente envolvida na criação e desenvolvimento de um pipeline de terapêutica diferenciada de anticorpos para o tratamento de doenças autoimunes graves usando sua plataforma de descoberta, o anticorpo simples, que explora caraterísticas do sistema imunológico de lhama. A empresa desenvolve um pipeline de terapias de anticorpos com foco em câncer e indicações autoimunes. Inclui, mas não se limita a: Empasiprbarbart, um inibidor do complemento que visa C2, bloqueando a função das vias clássica e lectina, deixando intacta a via alternativa, ARGX-119 um antagonista do recetor Musk com potencial em múltiplas indicações neuromusculares.', 'Amsterdam, , Netherlands', 1599);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ESTA', 'STOCK', 'Establishment Labs Holdings Inc.', 'NCM', 'Healthcare', 'Medical Devices', 'Establishment Labs Holdings Inc. is Costa Rica-based medical technology and aesthetics company that is focused on women''s health reconstruction market. The Company is engaged in the designing, developing, manufacturing and marketing of product portfolio consisting of silicone-filled breast and body shaping implants. The main activities are conducted at two manufacturing facilities in Costa Rica including Motiva Implants brand sold in over 80 countries globally through a combination of distributors and direct sales to customers.', 'Alajuela, , Costa Rica', 1056);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BLZE', 'STOCK', 'Backblaze, Inc.', 'NGM', 'Technology', 'Software - Infrastructure', 'Backblaze, Inc. is a cloud storage company. The Company''s two cloud services that it offers on its Storage Cloud are: Backblaze B2 Cloud Storage and Backblaze Computer Backup. Backblaze B2 Cloud Storage enables customers to store data, developers to build applications, and partners to expand their use cases. The amount of data stored in this cloud service can scale up and down as needed on a pay-as-you-go basis, or can be paid for on a capacity basis or committed contract for greater predictability. This Infrastructure-as-a-Service enables use cases including backups, multi-cloud, application storage, ransomware protection, and storage for artificial intelligence/machine learning workflows. Backblaze Computer Backup automatically backs up data from laptops and desktops for businesses and individuals. This service is offered as a subscription-based Software-as-a-Service and serves use cases including computer backup, ransomware protection, theft and loss protection, and remote access.', 'San Mateo, CA, United States', 346);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ONEQ', 'STOCK', 'Fidelity Nasdaq Composite Index ETF', 'NGM', NULL, NULL, 'The fund normally invests at least 80% of assets in common stocks included in the index. The advisor uses statistical sampling techniques that take into account such factors as capitalization, industry exposures, dividend yield, price/earnings (P/E) ratio, price/book (P/B) ratio, and earnings growth to create a portfolio of securities listed in the Nasdaq Composite Index® that have a similar investment profile to the entire index.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CYRX', 'STOCK', 'Cryoport, Inc.', 'NCM', 'Industrials', 'Integrated Freight & Logistics', 'Cryoport, Inc. provides temperature-controlled supply chain solutions for the Life Sciences, with an emphasis on regenerative medicine. The Company supports biopharmaceutical companies, contract manufacturers (CDMOs), contract research organizations (CROs), developers, and researchers with a comprehensive suite of services and products. Its integrated supply chain platform includes the Cryoportal Logistics Management Platform, advanced temperature-controlled packaging, informatics, specialized biologistics, biostorage, bioservices, and cryogenic systems. The Company''s segments include Life Sciences Services and Life Sciences Products. The Company''s Life Sciences Services segment provides cryogenic biostorage within the life science industry through direct sales. Its Life Sciences Products segment manufactures and sells cryogenic freezers, cryogenic dewars and accessories within the life science industry through direct sales or a distribution network.', 'Brentwood, TN, United States', 1090);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CENTA', 'STOCK', 'Central Garden & Pet Company', 'NMS', 'Consumer Defensive', 'Packaged Foods', 'Central Garden & Pet Company is engaged in the garden and pet industries. The Company offers a diverse portfolio of more than 65 brands, including Amdro, Aqueon, Cadet, C and S, Farnam, Ferry Morse, Four Paws, Kaytee, Nylabone, and Pennington. The Companys segments include Pet and Garden. The Pet segment includes dog and cat supplies such as treats and chews, toys, beds and containment, grooming products, waste management and training pads; supplies for aquatics, small animals, reptiles and pet birds including toys, enclosures and habitats, bedding, food and supplements; products for equine and livestock, animal and household health and insect control products; live fish and small animals as well as outdoor cushions. The Garden segment includes lawn and garden consumables such as grass seed; vegetable, flower and herb packet seed; wild bird feed, bird houses and other birding accessories; weed, grass, and other herbicides, insecticide and pesticide products, and live plants.', 'Walnut Creek, CA, United States', 6000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATHE', 'STOCK', 'Alterity Therapeutics Limited', 'NCM', 'Healthcare', 'Biotechnology', 'Alterity Therapeutics Limited is an Australia-based clinical-stage biotechnology company. The Company is focused on developing disease modifying treatments for neurodegenerative diseases. The Company''s lead asset, ATH434, is to treat various Parkinsonian disorders. ATH434 is an oral agent designed to inhibit the aggregation of pathological proteins implicated in neurodegeneration. It has the potential to treat Parkinson''s disease, as well as various Parkinsonian disorders, such as Multiple System Atrophy (MSA). The Company also has a drug discovery platform generating patentable chemical compounds to intercede in disease processes. ATH434 has been granted Orphan designation for the treatment of MSA. The Phase II clinical trial is a randomized, double-blind, placebo-controlled investigation of ATH434 in patients with early-stage MSA.', 'Melbourne, VIC, Australia', 10);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CATY', 'STOCK', 'Cathay General Bancorp', 'NMS', 'Financial Services', 'Banks - Regional', 'Cathay General Bancorp is the holding company of Cathay Bank (the Bank). The Bank offers a range of financial services and operates over 60 branches across the United States in California, New York, Washington, Texas, Illinois, Massachusetts, Maryland, Nevada, and New Jersey. It also has a branch outlet in Hong Kong, and representative offices in Beijing, Shanghai, and Taipei. The Bank provides financial services to diverse commercial and professional businesses in its market areas. It offers products and services to businesses, such as checking and deposit, lines of credits, commercial and commercial real estate loans, merchant services and payment processing, treasury management services, international banking and financing services, and other customary banking services. Through its Cathay Wealth Management business unit, the Bank offers clients a range of investment products and services, such as stocks, bonds, mutual funds, insurance, annuities, and advisory services.', 'Los Angeles, CA, United States', 1266);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BPOP', 'STOCK', 'Popular, Inc.', 'NMS', 'Financial Services', 'Banks - Regional', 'Popular, Inc. (Popular) is a financial holding company. The Company operates in two segments: Banco Popular de Puerto Rico (BPPR), which includes its Puerto Rico business, and Banco Popular North America (BPNA), which includes its the United States mainland business. The Company has operations in Puerto Rico, the United States and the Caribbean. The Company''s BPPR segment provides retail, mortgage and commercial banking services through its banking subsidiary, Banco Popular de Puerto Rico, as well as auto and equipment leasing and financing, investment banking, broker-dealer and insurance services through specialized subsidiaries. The Company''s BPNA segment consists of Popular North America, Inc. (PNA) functioning as the holding company for its operations in the United States. It also operates PNA''s subsidiary, E-LOAN, Inc. The banking operations of BPNA in the United States mainland are based in New York, Florida and New Jersey, conducted under the name of Popular Community Bank.', 'Hato Rey, PR, United States', 9303);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EVTR', 'STOCK', 'Eaton Vance Total Return Bond ETF', 'NYQ', NULL, NULL, 'Under normal circumstances, at least 80% of the fund’s net assets (plus the amount of any borrowings for investment purposes) will be invested in fixed-income securities. The fund invests primarily in a diversified mix of U.S. dollar-denominated investment grade fixed-income securities, including U.S. government, corporate, municipal, mortgage- and asset-backed securities.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BVFL', 'STOCK', 'BV Financial, Inc.', 'NCM', 'Financial Services', 'Banks - Regional', 'BV Financial, Inc. is the parent company of BayVanguard Bank (the Bank). The Bank is headquartered in Baltimore, Maryland with thirteen branches in the Baltimore metropolitan area and the eastern shore of Maryland. The Bank is a full-service community-oriented financial institution dedicated to serving the financial service needs of consumers and businesses. The Bank is engaged primarily in the business of attracting deposits from the public and using such funds to originate one-to-four-family real estate, construction, multifamily, commercial real estate, farm, marine loans, commercial and consumer loans. The Banks personal and business banking services include checking and money market accounts, certificates of deposit, savings, online banking, personal and business credit cards, and other services. The Banks lending services include personal and commercial lending, which offers real estate, lines of credit, home equity, construction, auto, boat, lot, and other loan services.', 'Baltimore, MD, United States', 109);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMZD', 'STOCK', 'Direxion Daily AMZN Bear 1X Shares', 'NGM', NULL, NULL, 'The fund, under normal circumstances, invests at least 80% of the it’s net assets (plus borrowings for investment purposes) in financial instruments, including swap agreements and options, that, in combination, provide 1X daily inverse (opposite) or short exposure to AMZN, consistent with the fund’s investment objective. It is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BMR', 'STOCK', 'Beamr Imaging Ltd.', 'NCM', 'Technology', 'Software - Application', 'Beamr Imaging Ltd is an Israel-based video technology and image science software company. Beamr Imaging Ltd provides video encoding, transcoding, and optimization software solutions that enable high quality, performance, and bitrate efficiency for live and Video on Demand (VOD) video services. Company''s product portfolio includes Codec SDKs- software development kit, CABRA Library is a Content Adaptive BitRate rate control library that integrates with existing hardware and software video encoders to reduce bitrates. JPEGmini Photo Opitmizer- a patented photo recompression technology which reduces the size of photographs without affecting their perceptual quality. Beamr Imaging Ltd operates globally.', 'Herzliya, , Israel', 38);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BLKB', 'STOCK', 'Blackbaud, Inc.', 'NMS', 'Technology', 'Software - Application', 'Blackbaud, Inc. provides software for powering social impact. It enhances its software with a range of payment processing, analytic and business intelligence services, consulting, training and professional services, and maintenance and technical support. Its specific solutions and services include fundraising and engagement, financial management, grant and award management, education solutions, social responsibility, employee giving and volunteering, payment services, data intelligence, customer success, customer support, professional and managed services and training. Its fundraising and engagement include Blackbaud Raiser''s Edge NXT, Blackbaud CRM, Blackbaud eTapestry, Blackbaud Luminate Online, Blackbaud TeamRaiser, JustGiving from Blackbaud, Blackbaud Fundraiser Performance Management, Blackbaud Altru, and Blackbaud Guided Fundraising and Blackbaud Volunteer Network Fundraising. Its grant and award management solutions include Blackbaud Grantmaking and Blackbaud Award Management.', 'Charleston, SC, United States', 2600);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AYTU', 'STOCK', 'Aytu BioPharma, Inc.', 'NCM', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Aytu BioPharma, Inc. is a pharmaceutical company focused on commercializing novel therapeutics. The Company''s business is focused on its prescription pharmaceutical products sold primarily through third party wholesalers and pharmacies and which primarily consists of two product portfolios. The first consists of two products for the treatment of ADHD: Adzenys XR-ODT (amphetamine) extended-release orally disintegrating tablets (Adzenys) and Cotempla XR-ODT (methylphenidate) extended-release orally disintegrating tablets. The second consists primarily of Karbinal ER (carbinoxamine maleate extended-release oral suspension), an extended-release first-generation antihistamine suspension containing carbinoxamine indicated to treat numerous allergic conditions, and Poly-Vi-Flor and Tri-Vi-Flor, two complementary prescription fluoride-based supplement product lines containing combinations of fluoride and vitamins in various formulations for infants and children with fluoride deficiency.', 'Denver, CO, United States', 102);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BEP', 'STOCK', 'Brookfield Renewable Partners L.P.', 'NYQ', 'Utilities', 'Utilities - Renewable', 'Brookfield Renewable Partners L.P. owns a portfolio of renewable power generating facilities in North America, Colombia, and Brazil. The company generates electricity through hydroelectric, wind, solar, distributed generation, and pumped storage; and offers sustainable solutions, such as renewable natural gas, carbon capture and storage, recycling, cogeneration, biomass, nuclear services, eFuels, and power transformation. Brookfield Renewable Partners Limited operates as the general partner of Brookfield Renewable Partners L.P. The company was formerly known as Brookfield Renewable Energy Partners L.P. and changed its name to Brookfield Renewable Partners L.P. in May 2016. The company was founded in 1999 and is based in Toronto, Canada.', 'Toronto, ON, Canada', 5270);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DOLE', 'STOCK', 'Dole plc', 'NYQ', 'Consumer Defensive', 'Farm Products', 'Dole plc is an Ireland-based company, which produces, markets, and distributes an extensive variety of fresh fruits and vegetables sourced locally and from around the world. The Company''s segments include Fresh Fruit, Diversified Fresh Produce - EMEA and Diversified Fresh Produce - Americas & ROW. Its Fresh Fruit segment primarily sells bananas and pineapples which are sourced from local growers or Company-owned and leased farms, predominately located in Latin America, and sold throughout North America, Europe, Latin America and Asia. This segment also operates a commercial cargo business. The Company''s Diversified Fresh Produce - EMEA segment includes its Irish, Dutch, Spanish, Portuguese, French, Italian, United Kingdom, Swedish, Danish, South African, Czech, Slovakian, Polish, German and Brazilian businesses. The Diversified Fresh Produce - Americas & ROW segment includes its United States, Canadian, Mexican, Chilean, Peruvian and Argentinian businesses.', 'Dublin, , Ireland', 35371);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BLD', 'STOCK', 'TopBuild Corp.', 'NYQ', 'Industrials', 'Engineering & Construction', 'TopBuild Corp. is an installer and specialty distributor of insulation and related building material products to the construction industry in the United States and Canada. The Companys segments include Installation and Specialty Distribution. The Installation segment primarily installs insulation and other building products. Installation sells primarily to the residential new construction market, commercial/industrial construction market, along with repair/remodel of residential housing. In addition to insulation, it installs other building products, including glass and windows, rain gutters, garage doors, closet shelving, and fireplaces, among other items. The Specialty Distribution segment distributes building and mechanical insulation, insulation accessories and other building product materials for the residential and commercial/industrial end markets. In addition to insulation and accessories, it distributes rain gutters, closet shelving, and roofing materials, among other items.', 'Daytona Beach, FL, United States', 13984);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CMTL', 'STOCK', 'Comtech Telecommunications Corp.', 'NMS', 'Technology', 'Communication Equipment', 'Comtech Telecommunications Corp. is a global technology company. The Company is engaged in providing terrestrial and wireless network solutions, next-generation 9-1-1 emergency services, satellite and space communications technologies, and cloud native capabilities to commercial and government customers around the world. It operates through two segments: Satellite and Space Communications, and Terrestrial and Wireless Networks. Its Satellite and Space Communications segment designs, builds and supports a variety of sophisticated communications equipment critical to modern communications infrastructures. Satellite and Space Communications segment is organized into four categories: satellite modem and amplifier technologies, troposcatter technologies, government services and space components. The Terrestrial and Wireless Networks segment has three service areas: next generation 911 and call delivery, Solacom call handling solutions, and trusted location and messaging solutions.', 'Chandler, AZ, United States', 1468);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DFH', 'STOCK', 'Dream Finders Homes, Inc.', 'NYQ', 'Consumer Cyclical', 'Residential Construction', 'Dream Finders Homes, Inc. is a homebuilder based in Jacksonville, Florida. The Company''s primary focus is on constructing and selling single-family homes across entry-level, first-time move-up, second-time move-up, and active adult markets. It builds single-family homes throughout the Southeast, Mid-Atlantic and Midwest, including Florida, Texas, Tennessee, North Carolina, South Carolina, Georgia, Colorado, Arizona, and the Washington, D.C. metropolitan area, which comprises Northern Virginia and Maryland. It also has homebuilding operations and assets in the Atlanta. The Company also owns captive pre-engineered panel and truss and building component import businesses. The Company also provides title insurance and mortgage banking solutions through its wholly owned subsidiaries, Golden Dog Title & Trust and Jet HomeLoans, LP. Its home offerings are marketed under various brands, including Dream Finders Homes, DF Luxury, Craft Homes, and Coventry Homes.', 'Jacksonville, FL, United States', 1686);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CFR', 'STOCK', 'Cullen/Frost Bankers, Inc.', 'NYQ', 'Financial Services', 'Banks - Regional', 'Cullen/Frost Bankers, Inc. is a financial holding company and a bank holding company. The Company provides an array of products and services throughout numerous Texas markets. The Company''s segments include Banking and Frost Wealth Advisors. The Banking segment includes both commercial and consumer banking services and Frost Insurance Agency. Commercial banking services are provided to corporations and other business clients and include a wide array of lending and cash management products. Consumer banking services include direct lending and depository services. Frost Insurance Agency provides insurance brokerage services to individuals and businesses covering corporate and personal property and casualty products, as well as group health and life insurance products. The Frost Wealth Advisors segment includes fee-based services within private trust, retirement services, and financial management services, including personal wealth management and securities brokerage services.', 'San Antonio, TX, United States', 5854);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CDZI', 'STOCK', 'Cadiz Inc.', 'NGM', 'Utilities', 'Utilities - Regulated Water', 'Cadiz Inc. is a water solutions provider with a combination of land, water, pipeline, and water filtration assets located in Southern California. The Company''s segments include Land and Water Resources, and Water Filtration Technology. The Land and Water Resources segment comprises all activities regarding its properties in the eastern Mojave Desert pre-revenue development of the Water Project (supply, storage and conveyance), and agricultural operations. The Water Filtration Technology segment comprises ATEC Water Systems LLC, its subsidiary, which provides water filtration solutions for impaired or contaminated groundwater sources. Its portfolio of assets includes over 2.5 million acre-feet of water supply, one million acre-feet of groundwater storage capacity, 220 miles of existing, underground pipeline, and versatile and scalable water filtration technology. It has over 46,000 acres of land with naturally recharging groundwater resources in Southern Californias Mojave Desert.', 'Los Angeles, CA, United States', 25);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CVGI', 'STOCK', 'Commercial Vehicle Group, Inc.', 'NMS', 'Consumer Cyclical', 'Auto Parts', 'Commercial Vehicle Group, Inc. is a global provider of systems, assemblies and components to the global commercial vehicle market and the electric vehicle market. The Company delivers solutions to complex design, engineering, and manufacturing problems. The Company operates through three segments: Vehicle Solutions, Electrical Systems and Aftermarket & Accessories. The Vehicle Solutions segment designs, manufactures and sells commercial vehicle seats and plastic and trim components for the global and North America commercial vehicle market. The Electrical Systems segment designs, manufactures and sells cable and harness assemblies for both high and low voltage applications, control boxes, dashboard assemblies and design and engineering for these applications. The Aftermarket & Accessories segment designs, manufactures, and sells seats and components; commercial vehicle accessories including wipers, mirrors, and sensors, and office seats.', 'New Albany, OH, United States', 6400);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FFIC', 'STOCK', 'Flushing Financial Corporation', 'NMS', 'Financial Services', 'Banks - Regional', 'Flushing Financial Corporation is the holding company for Flushing Bank (the Bank). The Bank offers the products, services, and conveniences associated with large commercial banks, including a full complement of deposit, loan, equipment finance, and cash management services. The Bank''s principal business is attracting retail deposits from the general public and investing those deposits together with funds generated from ongoing operations and borrowings, primarily in originations and purchases of multi-family residential properties loans, commercial business loans, commercial real estate mortgage loans and, to a lesser extent, one-to-four family loans; construction loans; small business administration (SBA) loans; mortgage loan surrogates, such as mortgage-backed securities; and United States government securities, corporate fixed-income securities and other marketable securities. The Bank also operates an Internet branch that operates under the brands of iGObanking.com and BankPurely', 'Uniondale, NY, United States', 571);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMZZ', 'STOCK', 'GraniteShares 2x Long AMZN Daily ETF', 'NGM', NULL, NULL, 'The fund is an actively managed exchange traded fund that attempts to replicate 2 times (200%) the daily percentage change of the underlying stock by entering financial instruments such as swaps and options on the underlying stock as well as directly purchasing the underlying stock. The fund will aim to primarily obtain its notional exposure against the underlying stock through swap agreements. The fund is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EVV', 'STOCK', 'Eaton Vance Limited Duration Income Fund', 'ASE', 'Financial Services', 'Asset Management', 'Eaton Vance Limited Duration Income Fund is a closed-ended fixed income mutual fund launched and managed by Eaton Vance Management. The fund invests in the fixed income markets of the United States. It primarily invests in senior, secured floating-rate loans, government agency mortgage-backed securities, and corporate bonds that are rated below investment grade. The fund seeks to maintain an average duration of three and a half years and average quality BBB/BBB- in its investments. It benchmarks the performance of its portfolio against the S&P/LSTA Leveraged Loan Index, the Merrill Lynch U.S. High Yield Index, and the Barclays Capital U.S. Intermediate Government Bond Index. Eaton Vance Limited Duration Income Fund was formed on May 30, 2003 and is domiciled in the United States.', 'Boston, MA, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FBK', 'STOCK', 'FB Financial Corporation', 'NYQ', 'Financial Services', 'Banks - Regional', 'FB Financial Corporation is a bank holding company. The Company operates through its wholly owned banking subsidiary, FirstBank, in Tennessee, Alabama, Kentucky, and Georgia. The Company operates through two segments: Banking and Mortgage. The Company''s Banking segment provides a full range of deposit and lending products and services to corporate, commercial and consumer customers. The Company also originates conforming residential mortgage loans through its Mortgage segment, whose activities include the servicing of residential mortgage loans and securitization of loans to third party private investors or government sponsored agencies. It operates approximately 93 full-service bank branches across its footprint. FirstBank also provides retail mortgage banking services utilizing its bank branch network and mortgage banking offices strategically located throughout the southeastern United States.', 'Nashville, TN, United States', 1490);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('NXXT', 'STOCK', 'NextNRG Inc.', 'NCM', 'Utilities', 'Utilities - Renewable', 'NextNRG, Inc., formerly EzFill Holdings, Inc., is focused on renewable energy, mobile fueling, and energy infrastructure. The Company is developing an integrated ecosystem that combines solar energy generation, battery storage, wireless electric vehicle (EV) charging, and on-demand fuel delivery by leveraging artificial intelligence (AI) and machine learning (ML) technologies. The Company is integrating sustainable energy solutions into mobile fueling operations. The Company focuses on providing renewable energy to its fueling partners, supporting efficient fuel delivery while advancing clean energy adoption. It is engaged in the deployment of NextNRG Smart Microgrids, which utilize AI-driven energy management alongside solar power and battery storage. These microgrids are designed to serve commercial properties, schools, hospitals, nursing homes, parking garages, rural and tribal lands, recreational facilities, and government properties.', 'Miami, FL, United States', 163);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNTX', 'STOCK', 'Context Therapeutics Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Context Therapeutics Inc. is a clinical-stage biopharmaceutical company, which is engaged in advancing T cell engaging (TCE) bispecific antibodies (bsAb) for solid tumors. It is building a portfolio of TCE bispecific therapeutics, including CTIM-76, a Claudin 6 (CLDN6) x CD3 TCE, CT-95, a Mesothelin (MSLN) x CD3 TCE, and CT-202, a Nectin cell adhesion protein 4 (Nectin-4) x CD3 TCE. CLDN6 is a tight junction membrane protein target expressed in multiple solid tumors and absent from or expressed at low levels in healthy adult tissues. CT-95 is intended to redirect T-cell-mediated lysis toward malignant cells expressing MSLN. MSLN is a membrane protein overexpressed in approximately 30% of cancers. Nectin-4 is a target for cancer therapy using a traditional antibody-drug conjugate, but it is also associated with certain adverse events, including neuropathy and rash. CT-202 is a pH-dependent TCE that is designed to be preferentially active within the acidic tumor microenvironment.', 'Philadelphia, PA, United States', 12);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BHFAN', 'STOCK', 'Brighthouse Financial, Inc.', 'NMS', 'Financial Services', 'Insurance - Life', 'Brighthouse Financial, Inc. is a provider of annuities and life insurance in the United States. The Companys segments include Annuities; Life; Run-off, and Corporate & Other. The Annuities segment consists of a variety of variable, fixed, index-linked and income annuities designed to address contract holders needs for protected wealth accumulation on a tax-deferred basis, wealth transfer and income security. The Life segment consists of insurance products, including term, universal, whole and variable life products designed to address policyholders needs for financial security and protected wealth transfer, which may be on a tax-advantaged basis. The Run-off segment consists primarily of products that are no longer actively sold and are separately managed, including universal life with secondary guarantees, structured settlements, pension risk transfer contracts, certain Company-owned life insurance policies and certain funding agreements.', 'Charlotte, NC, United States', 1400);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BGY', 'STOCK', 'BlackRock Enhanced International Dividend Trust', 'NYQ', 'Financial Services', 'Asset Management', 'BlackRock Enhanced International Dividend Trust is a closed ended equity mutual fund launched by BlackRock, Inc. The fund is co-managed by BlackRock Advisors, LLC and BlackRock International Limited. It invests in public equity markets across the globe excluding the United States. The fund seeks to invest in stocks of companies operating across diversified sectors. It invests in stocks of companies across all market capitalizations. The fund also invests through the use of derivatives, with an emphasis on options writing. It benchmarks the performance of its portfolio against the S&P Global ex-U.S. Broad Market Index. The fund was formerly known as BlackRock International Growth and Income Trust. BlackRock Enhanced International Dividend Trust was formed on May 30, 2007 and is domiciled in the United States.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CTNM', 'STOCK', 'Contineum Therapeutics, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Contineum Therapeutics, Inc. is a clinical-stage biopharmaceutical company, which is engaged in developing novel, oral small molecule therapies for neuroscience, inflammation and immunology (NI&I) indications with significant unmet need. It is advancing a pipeline of internally developed programs with multiple drug candidates in clinical trials. Its lead asset, PIPE-791, is a novel, brain-penetrant, small-molecule inhibitor of the lysophosphatidic acid 1 receptor (LPA1R) in development for idiopathic pulmonary fibrosis (IPF), progressive multiple sclerosis (PrMS), and chronic pain. Its second drug candidate, PIPE-307, is a novel, small-molecule selective inhibitor of the muscarinic type 1 receptor (M1R), in development for depression and relapse-remitting multiple sclerosis (RRMS). The Company is also conducting preclinical and discovery-phase experiments targeting other NI&I indications where its internally discovered molecules may have therapeutic potential.', 'San Diego, CA, United States', 41);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ANAB', 'STOCK', 'AnaptysBio, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'AnaptysBio, Inc. is a clinical-stage biotechnology company. The Company is focused on delivering immunology therapeutics for autoimmune and inflammatory diseases. The Companys lead program, Rosnilimab, is a depleter and agonist targeting PD-1+ T cells, is in a Phase IIb trial for the treatment of rheumatoid arthritis and in a Phase II trial for the treatment of ulcerative colitis. The Companys pipeline also includes ANB033, a CD122 antagonist, and ANB101, a blood dendritic cell antigen 2 (BDCA2) modulator, in Phase I trials. It has also discovered multiple therapeutic antibodies licensed to GSK in a financial collaboration for immuno-oncology, including a PD-1 antagonist (Jemperli (dostarlimab-gxly)) and a TIM-3 antagonist (cobolimab, GSK4069889). Rosnilimab is an IgG1 antibody that directly targets PD-1+ T cells, resulting in their depletion or agonism, impacting pathogenic drivers of autoimmune and inflammatory diseases.', 'San Diego, CA, United States', 136);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BTMD', 'STOCK', 'biote Corp.', 'NGM', 'Healthcare', 'Medical Care Facilities', 'biote Corp. operates a practice-building business within the hormone optimization space. The Company provides the necessary components to enable Biote-certified practitioners to establish, build and implement a program designed to optimize hormone levels using personalized solutions for their patient populations. The Biote Method is a comprehensive, end-to-end practice building platform that provides Biote-certified practitioners with the components specifically developed for practitioners in the hormone optimization space: Biote Method education, training and certification, practice management software, inventory management software, and information regarding available hormone replacement therapy (HRT) products, as well as digital and point-of-care marketing support. It also sells a complementary Biote-branded line of dietary supplements. The Biote Methods proprietary clinical decision support (CDS) software assists physicians in establishing individualized dosing for patients.', 'Irving, TX, United States', 217);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASTI', 'STOCK', 'Ascent Solar Technologies, Inc.', 'NCM', 'Technology', 'Solar', 'Ascent Solar Technologies, Inc. is a solar technology company that manufactures and sells photovoltaic (PV) solar modules. Its technology provides renewable power solutions to production and specialty solar markets where traditional rigid solar panels are not suitable, including aerospace, agrivoltaics, and niche manufacturing/construction sectors. It designs and develops finished products to design and develop integrated solutions for products, such as satellites, spacecraft, airships, and fixed wing unmanned aerial vehicles (UAVs). It is also engaged in developing its zinc oxysulfide process. The Company manufactures its products by affixing a thin Copper-Indium-Gallium-diSelenide (CIGS) layer to a plastic substrate using a large format, roll-to-roll process that permits it to fabricate its PV modules in an integrated sequential operation. It uses monolithic integration techniques, which enable it to form complete PV modules with back-end assembly of inter-cell connections.', 'Thornton, CO, United States', 16);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALTI', 'STOCK', 'AlTi Global, Inc.', 'NCM', 'Financial Services', 'Asset Management', 'AlTi Global, Inc. is an independent global wealth manager providing entrepreneurs, multi-generational families, institutions, and emerging leaders with fiduciary capabilities as well as alternative investment strategies and advisory services. Its Wealth & Capital Solutions segment provides holistic solutions for its wealth management and Outsourced Chief Investment Officer (OCIO) clients through a comprehensive array of wealth management services, including discretionary investment management services, non-discretionary investment advisory services, trust services, administration services, and family office services. Its International Real Estate segment assists its investors with real estate co-investments by providing access to highly differentiated opportunities in these areas as well as structuring and selecting partners with a proven track record in alternative asset classes, with attractive risk-adjusted return characteristics.', 'New York, NY, United States', 520);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CVRX', 'STOCK', 'CVRx, Inc.', 'NMS', 'Healthcare', 'Medical Devices', 'CVRx, Inc. is a commercial-stage medical device company. The Company is focused on developing, manufacturing and commercializing advanced neuromodulation solutions for patients with cardiovascular diseases. The Company''s integrated platform technology, Barostim, is designed to leverage the power of the brain and nervous system to address the imbalance of the autonomic nervous system (ANS), which causes heart failure with reduced ejection fraction (HFrEF) and other cardiovascular diseases. Barostim provides Baroreflex Activation Therapy (BAT) by sending imperceptible and persistent electrical pulses to baroreceptors located in the wall of the carotid artery to signal the brain to modulate cardiovascular function. Barostim is a minimally invasive neuromodulation device that consists of two implantable components, an implantable pulse generator (IPG) and a stimulation lead, and is programmed by a wireless clinician-controlled programmer that communicates with the IPG.', 'Minneapolis, MN, United States', 206);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AXTI', 'STOCK', 'AXT, Inc.', 'NMS', 'Technology', 'Semiconductor Equipment & Materials', 'AXT, Inc. is a material science company that develops and manufactures high-performance compound and single element semiconductor wafer substrates comprising indium phosphide (InP), gallium arsenide (GaAs) and germanium (Ge). Its wafer substrates are used when a typical silicon wafer substrate cannot meet the performance requirements of a semiconductor or optoelectronic device. It has two product lines: specialty material substrates and raw materials integral to these substrates. Its InP is a semiconductor wafer substrate used in broadband and fiber optic applications, 5G infrastructure and data center connectivity. Its semi-conducting GaAs substrates are used to create opto-electronic products, including high brightness light emitting diodes that are often used to backlight wireless handsets and LCD televisions and for automotive, signage, and lighting applications. Its Ge substrates are used in applications, such as solar cells for space and terrestrial photovoltaic applications.', 'Fremont, CA, United States', 1527);\n